DROP DATABASE IF EXISTS mlb_season_stats;

CREATE DATABASE IF NOT EXISTS mlb_season_stats;
USE mlb_season_stats;

CREATE TABLE season_stats_team (
    team_id varchar(3) NOT NULL PRIMARY KEY,
    team_name varchar(255) NOT NULL,
    league varchar(8) NOT NULL,
    region varchar(7) NOT NULL,
    wins int NOT NULL,
    losses int NOT NULL,
    result varchar(255) NOT NULL,
    stadium varchar(255) NOT NULL,
    manager_name varchar(255) NOT NULL
);

-- Initialize Teams

CREATE TABLE season_stats_batter (
    player_id int NOT NULL PRIMARY KEY AUTO_INCREMENT,
    player_name varchar(255) NOT NULL,
    team_id varchar(3) NOT NULL,
    position varchar(2) NOT NULL,
    age int NOT NULL,
    num_games int,
    at_bats int,
    runs int,
    hits int,
    doubles int,
    triples int,
    home_runs int,
    rbi int,
    stolen_bases int,
    caught_stealing int,
    walks int,
    strikeouts int,
    sac_hits int,
    sac_flies int,
    hit_by_pitch int,
    batting_average float,
    on_base_pct float,
    slugging float,
    ops float,
    CONSTRAINT batters_idfk FOREIGN KEY (team_id) REFERENCES season_stats_team (team_id)
);

CREATE TABLE season_stats_pitcher (
    player_id int NOT NULL PRIMARY KEY AUTO_INCREMENT,
    player_name varchar(255) NOT NULL,
    team_id varchar(3) NOT NULL,
    age int NOT NULL,
    num_games int,
    games_started int,
    complete_games int,
    shutouts int,
    innings_pitched float,
    hits int,
    earned_runs int,
    strikeouts int,
    walks int,
    home_runs int,
    wins int,
    losses int,
    saves int,
    blown_saves int,
    holds int,
    era float,
    whip float,
    CONSTRAINT pitchers_idfk FOREIGN KEY (team_id) REFERENCES season_stats_team (team_id)
);

